FEMALE: (
Fig. 3
): Similar to male, except tail longer ( 4.7 abd). Vulva at 50 % of body length, pore-like, clearly protrudes from body wall with thickened cuticle, coarse striations continuing over raised part and finer striations on inner vulva. Vagina short and straight without sclerotizations or epiptygmata. Didelphic, but anterior ovary shorter, ovaries outstretched. Ventral gland cell visible beside oesophageal bulb, but full extent not visible and position of anterior pore not seen. Supplements absent.
